import React, { useState } from 'react';
import { GameOfLife } from './components/Main';

type arrType = Array<Array<boolean>>;
const arrGenerator = (): arrType => {
  const numRows = Math.floor(window.innerHeight / 25);
  const numCols = Math.floor(window.innerWidth / 25);
  return Array.from({ length: numRows }, () => Array(numCols).fill(false));
};
const randomDarkGreenColor = (): string => {
  const greenValue = Math.floor(Math.random() * 51);
  return `rgb(0, ${greenValue}, 0)`;
};
function App() {
  const [theme, setTheme] = useState(arrGenerator);
  return (
    <div className='App'>
      {theme?.map((row, rowIndex) =>
        row?.map((item, colIndex) => (
          <div
            key={colIndex}
            style={{ backgroundColor: randomDarkGreenColor() }}
            className='theme'
          ></div>
        )),
      )}
      <GameOfLife />
    </div>
  );
}

export default App;
